import React from 'react'

import CoffeeImage from '../images/HeaderImage/CoffeeImage.jpg'

const CoffeePlant = () => {
  return (
    <div>
      <img src={CoffeePlant} alt='Image' />
    </div>
  )
}

export default CoffeePlant
